import React, { useState, useEffect } from 'react';
import { Bot } from 'lucide-react';
import { MeetingConfig, ScoreData, MeetingBot } from './types';
import Sidebar from './components/Sidebar';
import ConfigScreen from './components/ConfigScreen';
import ScorecardScreen from './components/ScorecardScreen';
import apiService from './services/api';

const App: React.FC = () => {
  const [bots, setBots] = useState<MeetingBot[]>([]);
  const [selectedBotId, setSelectedBotId] = useState<string | null>(null);
  const [config, setConfig] = useState<MeetingConfig>({
    meetingUrl: '',
    botName: '',
    startTime: ''
  });
  const [scoreData, setScoreData] = useState<ScoreData | null>(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const selectedBot = bots.find(bot => bot.id === selectedBotId);

  // Handle form submission for bot configuration
  const handleConfigSubmit = async () => {
    if (!selectedBotId) return;

    setLoading(true);
    setError(null);

    try {
      const result = await apiService.configureBot(selectedBotId, config);
      console.log('Bot configured successfully:', result);

      // Update the bot in the list
      setBots(prev => prev.map(bot => 
        bot.id === selectedBotId 
          ? { ...bot, config, status: 'configured', updatedAt: new Date().toISOString() }
          : bot
      ));

    } catch (err) {
      setError(err instanceof Error ? err.message : 'Configuration failed');
    } finally {
      setLoading(false);
    }
  };

  // Fetch score data
  const fetchScoreData = async () => {
    if (!selectedBotId) return;

    setLoading(true);
    setError(null);

    try {
      const data = await apiService.getScoreData(selectedBotId);
      setScoreData(data);

      // Update the bot in the list
      setBots(prev => prev.map(bot => 
        bot.id === selectedBotId 
          ? { ...bot, scoreData: data, status: 'completed', updatedAt: new Date().toISOString() }
          : bot
      ));
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Failed to fetch score data');
    } finally {
      setLoading(false);
    }
  };

  // Create new bot
  const handleNewBot = () => {
    const newBot: MeetingBot = {
      id: `bot-${Date.now()}`,
      name: `Bot ${bots.length + 1}`,
      status: 'configured',
      createdAt: new Date().toISOString(),
      updatedAt: new Date().toISOString(),
    };

    setBots(prev => [...prev, newBot]);
    setSelectedBotId(newBot.id);
    setConfig({ meetingUrl: '', botName: '', startTime: '' });
    setScoreData(null);
  };

  // Handle bot selection
  const handleBotSelect = (botId: string) => {
    setSelectedBotId(botId);
    const bot = bots.find(b => b.id === botId);
    if (bot) {
      if (bot.config) {
        setConfig(bot.config);
      }
      if (bot.scoreData) {
        setScoreData(bot.scoreData);
      }
    }
  };

  // Auto-fetch score data when bot has config but no score data
  useEffect(() => {
    if (selectedBot && selectedBot.config && !selectedBot.scoreData) {
      fetchScoreData();
    }
  }, [selectedBotId]);

  // Determine which screen to show
  const shouldShowScorecard = selectedBot && selectedBot.config && selectedBot.scoreData;
  const shouldShowConfig = selectedBot && (!selectedBot.config || !selectedBot.scoreData);

  return (
    <div className="min-h-screen bg-gray-50 text-black">
      <div className="flex h-screen">
        {/* Sidebar */}
        <Sidebar
          bots={bots}
          selectedBotId={selectedBotId}
          onBotSelect={handleBotSelect}
          onNewBot={handleNewBot}
        />

        {/* Main Content */}
        <div className="flex-1 flex flex-col">
          {/* Header */}
          <header className="bg-white border-b border-gray-200 px-6 py-4">
            <div className="flex items-center gap-3">
              <Bot className="w-6 h-6 text-primary-600" />
              <h1 className="text-xl font-bold text-black">Meeting Bot Dashboard</h1>
              {selectedBot && (
                <span className="text-gray-600">â€¢ {selectedBot.name}</span>
              )}
            </div>
          </header>

          {/* Content Area */}
          <main className="flex-1 p-6 overflow-y-auto">
            {!selectedBotId ? (
              <div className="flex items-center justify-center h-full">
                <div className="text-center">
                  <Bot className="w-16 h-16 text-gray-400 mx-auto mb-4" />
                  <h2 className="text-xl font-semibold text-gray-600 mb-2">No Bot Selected</h2>
                  <p className="text-gray-500">Select a bot from the sidebar or create a new one</p>
                </div>
              </div>
            ) : shouldShowScorecard ? (
              <ScorecardScreen
                scoreData={scoreData}
                config={selectedBot.config}
                onRefresh={fetchScoreData}
                loading={loading}
                error={error}
              />
            ) : shouldShowConfig ? (
              <ConfigScreen
                config={config}
                setConfig={setConfig}
                onSubmit={handleConfigSubmit}
                loading={loading}
                error={error}
              />
            ) : (
              <div className="flex items-center justify-center h-full">
                <div className="text-center">
                  <Bot className="w-16 h-16 text-gray-400 mx-auto mb-4" />
                  <h2 className="text-xl font-semibold text-gray-600 mb-2">Bot Ready</h2>
                  <p className="text-gray-500">Configure your bot to get started</p>
                </div>
              </div>
            )}
          </main>
        </div>
      </div>
    </div>
  );
};

export default App;
